import sidebar from './Sidebar.module.css'
import user_photo from './../../images/user-photo.png'

const Sidebar = () => {
    return(
        <div className={sidebar.sidebar}>
            <div className={sidebar.sidebar__user}>
                <img src={user_photo} alt=''></img>
                <p>Olena Burlaka</p>
            </div>
        </div>
    )
}

export default Sidebar;
